  input: '"TEXT","F3XA","","Mr. Bradley Decker Campaign Finance Analyst ReportsAnalysis
    Division  Identification Number:C00412643  Reference: Mid-Year Report (1/1/05-6/30/05)
    Dear Mr. Decker, This letter is in response to your preliminary review of the
    Unite Our States Mid-Year Report.  The Committee apologizes for the delayed response
    to your initial request for additional information. The request was received by
    the Committee just after a new Financial Assistant had joined the Committee staff
    and thus the letter was not reviewed by the Committee until just recently.In response
    to the information requested in the letter, the Committee is prepared to outline
    in detail the process whereby contributor information is collected. To comply
    with Commission regulations which require a committee to disclose the identification
    of all individuals who contribute in excess of $200 in a calendar year, the Committee
    includes clear requests for all necessary contributor information upon original
    solicitation. To begin with, the information requested is noted as required by
    Federal law. In addition the Committee asks that the contributor provide the following
    information; full name, mailing address, occupation and name of employer.   In
    the event that some or all of the above information requested is not initially
    provided, the Committee undertakes measures to ensure that ''best efforts'' are
    made to obtain the information. In this regard, the Committee sends a follow-up
    letter to the contributor requesting the missing information. Original letters
    to gather information were sent in July for those contributors whose employer
    or occupation fields were labeled as ''information requested.'' Upon receipt of
    further contributor information, the Committee will then amend the Report for
    which the information was requested to include the missing information.  This
    response will precede an amendment to the Mid-Year Report to reflect updated contributor
    information that the Committee has since received. In addition, the Committee
    will amend the contributor ''Self-Consultant'' description previously provided
    to a more specific and detailed description. Thank you in advance for your consideration.",""'
